import { Navbar, Nav, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import styles from '../Navigation/Navigation.module.css'

const Navigation = () => {
  return (
      <Navbar style={{backgroundColor: '#545454'}} collapseOnSelect expand="md" variant="dark"> 
          <Container fluid="lg">

          <Navbar.Brand href='/'>MIT | BWA</Navbar.Brand>

          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">


            <Nav className="ml-auto">

              <Nav.Link className="MenuItem" style={{paddingRight: '50px'}} href='/about'>about</Nav.Link>
              <Nav.Link style={{paddingRight: '50px'}} href='/exec'>exec</Nav.Link>
              <Nav.Link style={{paddingRight: '50px'}} href='/gallery'>gallery</Nav.Link>
              <Nav.Link style={{paddingRight: '50px'}} href='/calendar'>calendar</Nav.Link>
            </Nav>

          </Navbar.Collapse>
          </Container>

    </Navbar>
  );
}

export default Navigation;
